bindings:
Beste speurder,

Dit lieve teefje is nog opzoek naar een nieuw baasje. Het zijn beiden teefjes maar eentje heeft al een nieuw baasje gevonden.&nbsp;

Ze zijn 8 weekjes oud. Ook een beetje speels al.&nbsp;

Dit zijn oud duitse herders, als ze ouder worden hebben ze een langere vacht.&nbsp;

De stamboom is niet aanwezig maar heb wel een foto van haar ouders, ze is op een boerderij op 16 mei geboren met nog 5 broertjes en zusjes.&nbsp;

Paspoort, chip en vaccinatie heeft ze.

Voor filmpje en serieuze interesse stuur gerust een whatsapp berichtje op: 06 82 59 32 49.

Uit Emmen
